import PropTypes from 'prop-types';
import{Statistic} from './Statistic/Statistic.js';

export const StatisticsList = ({items}) => {
  return (<ul>
    {items.map(item => (
      <li key={item.id}>
        <Statistic item={item}/>
      </li>
    ))}
  </ul>)

}

StatisticsList.propTypes = {
  items: PropTypes.arrayOf(
    PropTypes.shape({
    id:PropTypes.string.isRequired,
  })
  ).isRequired,
}
